import React from "react";
import './index.css';


class Form extends React.Component{
    render()
    {
        return(
            <form onSubmit = {this.props.getWeather}>
                <input type ="text" nam ="city" placeholder ="Enter city name here..."/>
                <button  id ="search">Search</button>
            </form>
        );
    }
};
export default Form;
